@AOC Job 40 : 11 Cast abroad the rage of thy wrath: and behold every one that is proud, and abase him.

12 Look on every one that is proud, and bring him low; and tread down the wicked in their place.

13 Hide them in the dust together; and bind their faces in secret.

@DrPetra Spot on as ever. 

Forgiveness can only be given once sought. Forgiveness can never be demanded. 

Also as a principle, it’s value is not letting rage prevent you from loving again, not about the wellness of the abuser.
